        color: 'black',
        fontWeight: 500,
    }

    return (
        <div className='Parentdiv'>
            <div className='Childdiv' style={Childdiv}>
            </div>
            <p className='progresstext'>{`${progress}%`}</p>
        </div>
    )
}
